import React, { Component } from 'react';
import './App.css';
import Customers from './components/customers';
import { Row, Col, Container, Button } from 'reactstrap';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Container>
          <Row>
            <Col>
              <Button>test</Button>
            </Col>
          </Row>
          <Row>
            <Col xs="3" sm="3" md="3" lg="3" xl="3" style={{backgroundColor: "red"}}>
              <Button>test</Button>
            </Col>
            <Col xs="3" sm="3" md="3" lg="3" xl="3">
              <Button>test</Button>
            </Col>
          </Row>
        </Container>
        <Customers />
      </div>
    );
  }
}

export default App;
